import ImgLogo from './logovuavia.png';
import share1 from './chia-se-moi-nhat-1.png'
import share2 from './chia-se-moi-nhat-2.png';
import share3 from './chia-se-moi-nhat-3.png';
import share4 from './chia-se-moi-nhat-4.png';

const Logo = {
    ImgLogo,
    share1,
    share2,
    share3,
    share4,
};
export default Logo;
